import {FaShoppingCart} from "react-icons/fa";

const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fmedia.sproutsocial.com%2Fuploads%2F2022%2F09%2FShopping-apps.jpg&tbnid=62yHqr1ICRPZnM&vet=12ahUKEwik1u-Vg_CBAxVjoekKHfrxALEQMygkegUIARC9AQ..i&imgrefurl=https%3A%2F%2Fsproutsocial.com%2Finsights%2Fshopping-apps%2F&docid=2vc8Y5Kw4siX7M&w=780&h=440&q=shopping%20app%20images&ved=2ahUKEwik1u-Vg_CBAxVjoekKHfrxALEQMygkegUIARC9AQ"/>
        <div>
          <p>Home</p>
          <FaShoppingCart/>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
